import React from 'react';

const UserList = ({users}) => {
    console.log(users)
    return(
        <div>
            {users.map(user=>{
                return (<div key = {user.contactName}>
                    
                    {user.contactName}
                    <br/>
                    
                </div>);
            })}
            
            
            


        </div>
    );
};

export default UserList;
